import React, { Component } from "react";

class Toolbar extends Component {

  constructor(props) {
    super(props);

    this.state = {
      email: "",
      password: ""
    };
  }

  render() {
    return (
      <div id="toolbar">toolbar</div>
    )
  };
}


export default Toolbar;
